def d_init(n):
  c = 0
  A = D.items()[:]
  for i, e in A:
    c += 1
    for j, f in A[c:]:
      a = abs(e-f)
      D[(i, j)] = a
      D[(j, i)] = a
  return

def solve(p, v, w):
  if v == (1<<n)-1: return 0, N[p]
  a, b = dp[p][v]
  if a >= 0: return a, b

  T = 1e10
  for i in range(n):
    i1 = 1<<i
    if (v & i1) == 0:
      a, b = solve(i, v|i1, w + W[i])
      a += D[(i, p)] * w
      if T > a:
        T = a
        R = b
  R = N[p] + R
  dp[p][v] = [T, R]
  return T, R

